Death Masks

History Documentary hosted by William Graves, published by History Channel in 2009 - English narration


Information
------------------------------

Faces...and facts...fleshed out from the grave. Unprecedented technology brings to life extraordinary mirror images and powerful last impressions of history's most powerful men. Every line, every wrinkle, every expression tells a story. Forensic-science and anthropology experts have identified that history's most relevant figures left behind highly-detailed castsof their faces, created at their moment of death, to preserve their souls and physical memory for eternity. Using advanced facial-reconstruction techniques and 3-D imprint detailing, these death masks render an exact replica of every feature, and an intimate look at how their characteristics affected their lives. Includes startling new insights into the persistent mysteries surrounding these historic icons like Julius Caesar, Abraham Lincoln, Napoleon and George Washington, and just may reveal some secrets these men preferred to conceal.

